import { render } from 'react-dom';
import React, { Component } from 'react';
import axios from 'axios'

class Search extends Component {

  constructor(props) {
    super(props);
    this.state = {
      data: []
    };
  }

  componentDidMount() {
    axios.get('https://collections.thulb.uni-jena.de/api/v1/search?q=+cbuUnitTypes.actual:(33.0%20%20%20%20%20%20%20%20%20%2033.1)&wt=json')
      .then(response => {
        const data = response.data.results;
        this.setState({ data })
      })
      .catch(error => {
        console.log(error);
      })
  }

  render() {

    return (
      <div className="App">
        {this.state.data.map((item, index) => <UserList key={index} {...item} />)}
      </div>
    );
  }
}

const UserList = (props) => (
  <p><strong>name : </strong> {props.name.first}</p>
)

export default Search;
